import { SAVE_LOGED_EMAIL } from '../actions';

// Esse reducer será responsável por tratar as informações da pessoa usuária
const INITIAL_STATE = {
  logedEmails: [],
};

const userReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  case SAVE_LOGED_EMAIL:
    return {
      ...state,
      logedEmails: [email],
    };
  default:
    return state;
  }
};

export default userReducer;
